import React from 'react'
import { Card } from './Card';
import { SimpleGrid, Grid, Flex, Spacer, Box, space, GridItem } from '@chakra-ui/react';

export const CardGrid = ({data}) => {
  return (
    <Box py='50px'  mx='50px'>
        <SimpleGrid columns={[3, 3, 5]} spacing='40px'>
                {data.map((item)=><Card item={item}/>)} 
        </SimpleGrid>
        </Box>

  )
}
